import React, { useState } from 'react';
import styled from 'styled-components';
import Friend from './Friend';

const FriendsListBlock = styled.div`
  width: 45%;
  max-height: 650px;
  overflow-y: auto;
`;

const friendsList = [
  {
    profileImage: '1646621980718.jpeg',
    nickname: '123',
    tags: ['운동', '영화', '축구', '강아지랑 산책'],
  },
  { profileImage: '1646702364540.jpeg', nickname: 'nani', tags: [] },
  { nickname: 'abcd', tags: [] },
];

const FriendsList = () => {
  return (
    <FriendsListBlock>
      {friendsList.map(({ profileImage, nickname, tags }) => (
        <Friend profileImage={profileImage} nickname={nickname} tags={tags} />
      ))}
    </FriendsListBlock>
  );
};

export default FriendsList;
